import React, { useState } from 'react';
import logo from '../assets/logo.png';
import { Link } from 'react-router-dom';
import { AiOutlineClose, AiOutlineMenu } from 'react-icons/ai';
import { HoverBorderGradient } from '../uicomponents/HoverBorderGradient'; // Assuming you saved the gradient component in the same folder

const NavBar = () => {
  const [nav, setNav] = useState(true);

  const handleNav = () => {
    setNav(!nav);
  };

  return (
    <div className="flex justify-between items-center h-auto max-w-auto mx-auto px-6 text-white bg-blue-200 relative z-50 shadow-lg">
      <div className="flex items-center space-x-4">
        <Link to="/">
          <img src={logo} alt="logo" className="h-14 w-14 cursor-pointer transform transition duration-300 hover:scale-110" />
        </Link>
        <Link to="/">
          <p className="font-bold text-black text-2xl md:text-3xl font-sans">Tesla Academy</p>
        </Link>
      </div>

      {/* Desktop Navbar */}
      <ul className="hidden text-black md:flex space-x-6 text-lg font-medium">
        <li className="p-4 hover:text-teal-900 transition duration-300"><Link to="/courses">Courses</Link></li>
        <li className="p-4 hover:text-teal-900 transition duration-300"><Link to="/forum">Forum</Link></li>
        <li className="p-4 hover:text-teal-900 transition duration-300"><Link to="/aboutus">About Us</Link></li>
        <li className="p-4 hover:text-teal-900 transition duration-300"><Link to="/admin">Admin Test</Link></li>
        <li className="p-4 hover:text-teal-900 transition duration-300"><Link to="/enquiry">Enquiry</Link></li>
      </ul>

      <Link to="/login">
        <HoverBorderGradient
          containerClassName="hidden md:flex m-1"
          className="w-auto bg-gradient-to-r from-blue-500 via-blue-600 to-blue-700 text-white rounded-full px-6 py-3 transform transition-all duration-300 hover:scale-105 hover:shadow-lg"
          as="button"
          duration={1}
          clockwise={true}
        >
          Login
        </HoverBorderGradient>
      </Link>

      {/* Mobile Menu Icon */}
      <div onClick={handleNav} className="block md:hidden text-black cursor-pointer">
        {!nav ? <AiOutlineClose size={30} /> : <AiOutlineMenu size={30} />}
      </div>

      {/* Mobile Menu */}
      <div
        className={`${
          !nav ? 'fixed left-0 top-0 w-1/2 h-full bg-teal-500 bg-opacity-90 z-50' : 'fixed left-[-100%] z-50'
        } shadow-lg transition-all duration-500 ease-in-out`}
      >
        <Link to="/">
          <img src={logo} alt="logo" className="h-20 w-20 m-4" />
        </Link>
        <ul className="p-4 uppercase space-y-6 font-medium text-xl text-white">
          <li className="p-4 border-b border-gray-700 hover:bg-teal-600"><Link to="/login">Login</Link></li>
          <li className="p-4 border-b border-gray-700 hover:bg-teal-600"><Link to="/courses">Courses</Link></li>
          <li className="p-4 border-b border-gray-700 hover:bg-teal-600"><Link to="/forum">Forum</Link></li>
          <li className="p-4 border-b border-gray-700 hover:bg-teal-600"><Link to="/aboutus">About Us</Link></li>
          <li className="p-4 border-b border-gray-700 hover:bg-teal-600"><Link to="/admin">Admin Test</Link></li>
          <li className="p-4 border-b border-gray-700 hover:bg-teal-600"><Link to="/enquiry">Enquiry</Link></li>
        </ul>
      </div>
    </div>
  );
};

export default NavBar;
